import React from 'react';
import './App.css';

function App() {
  const onTellJoke = () => {
    console.log("click")
    fetch('https://icanhazdadjoke.com/', {
      method:GET
    })
  }

  return (
    <div>
      <button onClick={onTellJoke} >Tell me a Joke</button>
    </div>
  );
}

export default App;
